import React from "react";
import "../../styles/Familiar.css";
import ResolviendoConflictos from "./ResolviendoConflictos";
import ApoyoMutuo from "./ApoyoMutuo";

export default function Familiar({ setSubmodulo }) {
  return (
    <div className="familiar-container">
      <h1 className="familiar-title">Módulo Familiar</h1>
      <p className="familiar-descripcion">
        En este módulo fortalecerás tus relaciones con los miembros de tu familia
        mediante actividades centradas en la comunicación, el respeto y la cooperación.
      </p>

      <div className="familiar-botones">
        <button className="familiar-boton" onClick={() => setSubmodulo("resolviendoConflictos")}>
          Resolviendo Conflictos
        </button>
        <button className="familiar-boton" onClick={() => setSubmodulo("apoyoMutuo")}>
          Apoyo Mutuo
        </button>
      </div>
    </div>
  );
}
